
Vtiger_Detail_Js("Calendar_Detail_Js",{deleteRecord:function(b){var a=app.vtranslate("LBL_DELETE_CONFIRMATION");Vtiger_Helper_Js.showConfirmationBox({message:a}).then(function(c){app.showModalWindow($(".typeRemoveModal").clone(),function(d){d.find(".typeSavingBtn").click(function(g){var f=$(g.currentTarget);app.hideModalWindow();AppConnector.request(b+"&ajaxDelete=true&typeRemove="+f.data("value")).then(function(e){if(e.success==true){window.location.href=e.result}else{Vtiger_Helper_Js.showPnotify(e.error.message)}})})})})},},{});